            'No_challenge': 'Here you‘ll find the articles of your current challenge. No challenge active yet? Start a new one and get your motivation boosted!',
            'click': 'Book your challenge here.',
            '60 Tage, die dein Leben verändern. Wir starten mit der 5-tägigen Boost-Phase und gehen dann Themen wie Fettverbrennung, Darmgesundheit und Schlaf an! Plus Bonus-Rezepte!': '60 day Total Body Reset. We start with 5 days BOOST. Then let\'s head into topics like fatburn, gut health and efficient sleep! Plus bonus recipes!',
            'Hier geht\'s um die Basics einer gesunden Foodpunk Ernährung. Zusätzlich versorgen wir dich mit den besten Tricks zur App-Nutzung und einer großen Portion Motivation!': 'Learn about the basics of a healthy foodpunk nutrition and get support and motivation along the way.',
            'Lerne, wie du mit Nahrung dein Immunsystem verändern kannst und hol dir Immun-Booster Rezepte.': 'You\'ll learn about the impact of food on your immune system and we\'ll add some special immune booster recipes.',
            '8 Wochen funktionelles Training mit Sportwissenschatlerin Lisa Arndt. Jede Woche gibt es 3 neue Workouts mit abwechslungsreichen Übungen ohne Equipment.': ' 8 weeks functional training with your coach and sports scientist Lisa Arndt. You\'ll receive 3 new workouts every week. No equipment needed!',
            'Erlebe die Kraft der Ketose. Diese Challenge eignet sich am besten, wenn du in deinem Fragebogen die ketogene Ernährung wählst (30 g Kohlenhydrate am Tag).': 'Experience the power of ketosis. This challenge works best, if you set your carbohydrates to 30 g per day (keto) in your questionnaire.',
            'Schneller Einstieg zur Nutzung der App': 'Quick start to using the App',
            'Dieses Programm enthält die Aufzeichnungen von 7 Live Videos mit 20-minütigen Home Workouts. Deine Trainerin ist Sportwissenschaftlerin Lisa Arndt.': 'This program contains the recordings of 7 Live Workouts - 20 minutes each - with sports scientists Lisa Arndt.',
            'Verbessere deine Lipödem-Beschwerden mit der ketogenen Ernährung. Entwickelt in Zusammenarbeit mit führenden Lipödem-Experten. Inklusive 2 x 20 Minuten Telefoncoaching und 200 Foodpunkten im Gesamtwert von rund 100 €.': 'Mitigate the afflictions caused by your lipedema with the ketogenic diet. Developed in collaboration with lipedema experts. Including 2 x 20 minutes of personal coaching and 200 foodpoints worth approx. 100€.',
            'Say no to sugar! Verzichte mit dieser Challenge 30 Tage auf Industriezucker. Wir unterstützen dich dabei täglich mit verschiedenen Beiträgen in deiner App: Spannendes Hintergrundwissen, eine Zusatzportion Motivation und Ideen für leckere, zuckerfreie Alternativen.': 'Say no to sugar! Dispense with industrial sugar for 30 days. With this challenge we support you daily with various input in your app: exciting background knowledge, an addition portion of motivation and ideas for delicious, sugar-free alternatives.',
            '24 days Christmas Countdown plus 7 bonus days. With sugarfree christmas cookie recipes, delicious drinks and inspiration for your menu on christmas and new years eve. #fitbeforechristmas': '24 days Christmas Countdown plus 7 bonus days. With sugarfree christmas cookie recipes, delicious drinks and inspiration for your menu on christmas and new years eve. #fitbeforechristmas',
            '30 days that will change your life. We start with the 3-day Boost phase and push in the following 4 phases: Fat Burning, Inner Glow, Anti-Aging and New me.': '30 days that will change your life. We start with the 3-day Boost phase and push in the following 4 phases: Fat Burning, Inner Glow, Anti-Aging and New me.',
            'Say no to sugar! Verzichte mit dieser Challenge 45 Tage auf Industriezucker. Wir unterstützen dich dabei täglich mit verschiedenen Beiträgen in deiner App: Spannendes Hintergrundwissen, eine Zusatzportion Motivation durch digitale Live Events und Rezeptideen für leckere, zuckerfreie Alternativen.': 'Say no to sugar! Give up industrial sugar for 45 days with this challenge. We will support you daily with various contributions in your app: exciting background knowledge, an additional portion of motivation via digital live events and recipe ideas for delicious, sugar-free alternatives.',
            'Hier findest du Wissensseminare zu Themen wie z.B. ketogene Ernährung, intermittierendes Fasten oder #sixpackchallenge. Lerne deinen Körper noch besser zu verstehen und erfahre, wie du ihn durch gute Entscheidungen unterstützen kannst.': 'Discover our knowledge seminars with topics like ketogenic diet, intermittent fasting or #sixpackchallenge. Learn to understand your body better and discover how you can support him with good decisions.',
            '28 Tage Fatburn Focus - voller Power in dein neues Leben!': '28 days Fatburn Focus - filled with energy into your new life!',
            '31 Tage, die dein Leben verändern. Wir starten mit der Boost-Phase und pushen in den weiteren 3 Phasen: Fettverbrennung, Inner Glow und Anti-Aging.': '31 days that change your life. We start with the Boost phase and push in the additional 3 phases: Fat Burn, Inner Glow and Anti-Aging.',
            'Wie man den perfekten Bikini Body bekommt? Einfach einen Bikini anziehen. JEDER Körper ist der perfekte Bikinikörper. Wir helfen dir, dich im Sommer rundum wohlzufühlen.': 'How to get the perfect bikini body? Have a body. Wear a bikini. We help you to feel confident and great in your summer holiday.',
            'Say no to Sugar! Verzichte mit dieser Challenge 44 Tage auf Industriezucker. Wir unterstützen dich dabei täglich in deiner App mit spannendem Hintergrundwissen, Motivation und Rezeptideen für leckere zuckerfreie Alternativen.': 'Say no to Sugar! Eliminate industrial sugar for 44 days with this challenge. We support you daily in your app with interesting background knowledge, motivation and recipe ideas for delicious sugar-free alternatives.',
            'Unterstütze deinen Darm mit dieser Detoxkur und freu dich auf strahlende Haut, eine gute Verdauung, erholsamen Schlaf, einen gesunden Stoffwechsel und viel Energie!': 'Support your gut with this detox program and you will get glowing skin, good digestion, restful sleep, a healthy metabolism and lots of energy!',
